import * as React from "react"
import Toolbar from "@mui/material/Toolbar"
import Typography from "@mui/material/Typography"
import styled from "styled-components"
import AOS from "aos"
import { useEffect } from "react"
import { AppBar, Box, Container, Grid2, List } from "@mui/material"

// Styling the Navbar text
const NavbarText = styled(Typography)`
  color: white;
  font-family: "poppins";
`
const TopBar = styled(Box)`
  background-color: black;
  display: flex;
  justify-content: center;
  height: 44px;
  display: none;
`

const NavbarMain = styled(Navbar)`
  display: flex;
  justify-content: center;
  align-items: center;
`
const Navbartext= styled(Typography)`
  font-family:"Poppins";
`

export default function Navbar() {
  useEffect(() => {
    AOS.init({
      duration: 2000,
    })
  }, [])

  return (
    <>
      <TopBar>
        <Toolbar>
          <NavbarText>
            Summer Sale: All Swim Suits And Free Express Delivery - OFF 50%!
            Shop Now
          </NavbarText>
        </Toolbar>
      </TopBar>
      <AppBar>
        <Container>
          <Grid2 container >
            <Grid2 size={4}>
              <Typography variant="h4"> Exclisive </Typography>
            </Grid2>
            <Grid2 container>
              <Grid2 size={2}>
                <Navbartext>Home</Navbartext>
              
              </Grid2>
              <Grid2 size={2}>
                
              </Grid2>
              <Grid2 size={2}>
                
              </Grid2>
              <Grid2 size={2}>
                
              </Grid2>

            </Grid2>
          </Grid2>
        </Container>
      </AppBar>
    </>
  )
}
